import React, { useEffect, useState } from "react";
import axios from "axios";

const MedicineBookings = () => {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8000/medical_store_app/admin/bookings/"
        );
        setBookings(
          response.data.map((booking) => ({
            ...booking,
            medicine: booking.product, // Map product to medicine
            actionTaken: booking.status || null, // Sync actionTaken with status
          }))
        );
      } catch (error) {
        console.error("Error fetching bookings:", error);
      }
    };

    fetchBookings();
  }, []);

  const updateStatus = async (bookingId, status) => {
    try {
      // Make API call to update the status in the backend
      const response = await axios.post(
        `http://localhost:8000/medical_store_app/bookings/${bookingId}/update/`,
        { status }
      );

      // Confirm the status was successfully updated
      if (response.status === 200) {
        setBookings((prevBookings) =>
          prevBookings.map((booking) =>
            booking.id === bookingId
              ? { ...booking, status, actionTaken: status }
              : booking
          )
        );
        alert("Booking status updated!");
      } else {
        alert("Failed to update booking status. Please try again.");
      }
    } catch (error) {
      console.error("Error updating booking status:", error);
      alert("An error occurred while updating the status.");
    }
  };

  return (
    <div style={containerStyle}>
      <h1 style={titleStyle}>Admin - Manage Bookings</h1>
      <table style={tableStyle}>
        <thead>
          <tr>
            <th style={headerStyle}>Customer</th>
            <th style={headerStyle}>Medicine</th>
            <th style={headerStyle}>Quantity</th>
            <th style={headerStyle}>Status</th>
            <th style={headerStyle}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {bookings.length === 0 ? (
            <tr>
              <td colSpan="5" style={emptyRowStyle}>
                No bookings found
              </td>
            </tr>
          ) : (
            bookings.map((booking) => (
              <tr key={booking.id}>
                <td style={cellStyle}>{booking.customer}</td>
                <td style={cellStyle}>{booking.medicine}</td>
                <td style={cellStyle}>{booking.quantity}</td>
                <td style={cellStyle}>
                  {booking.status ? booking.status : "No status"}
                </td>
                <td style={cellStyle}>
                  {booking.actionTaken ? (
                    <span style={statusStyle(booking.actionTaken)}>
                      {booking.actionTaken}
                    </span>
                  ) : (
                    <>
                      <button
                        onClick={() => updateStatus(booking.id, "Confirmed")}
                        style={buttonStyle("green")}
                      >
                        Confirm
                      </button>
                      <button
                        onClick={() => updateStatus(booking.id, "Rejected")}
                        style={buttonStyle("red")}
                      >
                        Reject
                      </button>
                    </>
                  )}
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

const containerStyle = {
  padding: "60px",
  fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  backgroundColor: "#f9f9f9",
  minHeight: "100vh",
};

const titleStyle = {
  textAlign: "center",
  marginBottom: "20px",
  color: "#333",
  fontSize: "24px",
};

const tableStyle = {
  width: "100%",
  borderCollapse: "collapse",
  backgroundColor: "white",
  boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
  borderRadius: "8px",
  overflow: "hidden",
};

const headerStyle = {
  backgroundColor: "#007bff",
  color: "white",
  padding: "15px",
  textAlign: "left",
  fontWeight: "bold",
  borderBottom: "2px solid #ddd",
};

const cellStyle = {
  padding: "15px",
  borderBottom: "1px solid #ddd",
  color: "#333",
  textAlign: "left",
};

const emptyRowStyle = {
  textAlign: "center",
  padding: "20px",
  color: "#888",
};

const buttonStyle = (color) => ({
  backgroundColor: color,
  color: "white",
  border: "none",
  padding: "10px 15px",
  margin: "0 5px",
  borderRadius: "5px",
  cursor: "pointer",
  fontWeight: "bold",
  fontSize: "14px",
  transition: "background-color 0.3s",
});

const statusStyle = (action) => ({
  color: action === "Confirmed" ? "green" : "red",
  fontWeight: "bold",
});

export default MedicineBookings;
